import React, { Component } from "react";
import { Nav } from "react-bootstrap";
import "../../style/Student.css";

export default class StudentNavMenuElement extends Component {
  constructor(props) {
    super(props);

    this.onSelectHandler = this.onSelectHandler.bind(this);
  }
  onSelectHandler(key) {
    alert("someone clicked");
  }

  render() {
    return (
      <Nav.Item
        eventkey={this.props.iden}
        className="snm-element"
        onClick={(key) => this.onSelectHandler(key)}
      >
        <div className="snm-cont-icon">
          <i
            className={"snm-icon fa " + this.props.componentIcon}
            aria-hidden="true"
          ></i>
        </div>
        <div className="snm-element-name">{this.props.componentName}</div>
      </Nav.Item>
    );
  }
}
